 &lt;p&gt;一直小打小闹，运气一般。股票、数字货币都是亏。&lt;/p&gt;
&lt;p&gt;想通了，囤点资金先入手一个小户型，在成都也算是有了一个歇脚的地方。&lt;/p&gt;
&lt;p&gt;除却生活上的刚需，今后也有了明确的打算，调整自己的恩格尔系数。个人策略例如学历提升、创业、改行等暂时不考虑了，能有外包项目最好，被动收入于我而言就像画饼，不如主动争取来得实在。&lt;/p&gt;
&lt;p&gt;另外，个人情商也得多锻炼一下了，不能做到同龄人最好，但也不能是最差的。&lt;/p&gt;
&lt;p&gt;中国人天性居安思危，无数同龄人依然马不停蹄地追寻未来甘作社畜、拼命内卷，我怎愿落于下风？&lt;/p&gt;
&lt;p&gt;鸡汤还需读，工作安排得越满档越好，没时间去学李清照吃饱了饭还唉声叹气，就不会有太多烦恼😄&lt;/p&gt;
&lt;p&gt;最后勉励自己，通过自己努力奋斗而来的东西，必将倍加珍惜，我经历的过程乃至结果，都将使我更加自信、乐观，更能应对接下来的不知名的风险。&lt;/p&gt;
